window.bookSummaryJSON = "<p><b>Is it possible that I've finally found my place in these realms; that I've finally found my answers?</b></p> <p>As with everything in life, it could be so easily taken away. We've seen the pain and destruction heading towards the magic realm if we do nothing. The journey we've taken so far has revealed so much more than we were searching for.</p> <p>Nothing will ever be the same if we fail, or even if we win. Isn't that what we want? To make the changes that needed fighting for? Sometimes, I look at the realm that is screaming out for me to save it, and I don't know if it's worth fighting for.</p> <p>Decisions need to be made, and in the end, it will all be paid for in blood. Now, with the end in sight, it's time to decide how much more I'm willing to bleed for these people.</p> <p><i>This is an adult reverse harem book involving MMFM relationships. Intended for mature listeners.</i></p>"; 
